import React from 'react';
import Card from './Card/Card'
import Switch from './Switch/Switch';
import SearchBar from './SearchBar/SearchBar';
import {Button} from 'react-bootstrap';
import Styles from './ActiveDisplay.module.css';

//hook
import useActiveDisplay from './useActiveDisplay';
//Context
import ActiveDisplayContext from './ActiveDisplayContext';

const ActiveDisplay = ()=>{
     // this brings in the context and the function to update the state provided by the context;
    return (
        <div className = {Styles.container}>
            <Switch></Switch>
      
                    <SearchBar></SearchBar>
            <Card></Card>
        </div>
    )
}
export default ActiveDisplay;
